#' to the client. The available operations are listed in the
#' Operations section.
#'
#' @rdname lightsail
#' @export
lightsail <- function(config = list(), credentials = list(), endpoint = NULL, region = NULL) {
  paws.compute::lightsail(
    config = config,
    credentials = credentials,
    endpoint = endpoint,
    region = region
  )
}

