serverlessapplicationrepository <- function(config = list(), credentials = list(), endpoint = NULL, region = NULL) {
  paws.compute::serverlessapplicationrepository(
    config = config,
    credentials = credentials,
    endpoint = endpoint,
    region = region
  )
}

