#'
#' @rdname datapipeline
#' @export
datapipeline <- function(config = list(), credentials = list(), endpoint = NULL, region = NULL) {
  paws.analytics::datapipeline(
    config = config,
    credentials = credentials,
    endpoint = endpoint,
    region = region
  )
}

